import './Posts.css';
import Post from "./Post/Post";
import CreatePostButton from "./CreatePostButton/CreatePostButton";
import {add_post} from "../../../../redux/state";

const Posts = (props) => {
	console.log(
		[].concat(props.state.posts_data).reverse()
	)
	let posts_elements = props.state.posts_data.map(
		entry => <Post title={entry.title} content={entry.content}/>
	)

	return (
		<section className='posts'>
			<div className="posts__title">My posts</div>
			<div className='posts__create_button'>
				<CreatePostButton add_post={add_post}/>
			</div>
			<div className="posts__items">
				{ posts_elements }
			</div>

			<div className="general_profile__title">Profile</div>

		</section>
	)
}

export default Posts;
